import React from "react";
import "../css/home.css";

const Home = () => {
  return (
    <div className="homeFlexContainer">
      <nav className="homeNavContainer">
        <a className="homeLinkNav" href="">
          Boutons
        </a>
        <a className="homeLinkNav" href="">
          Panneau
        </a>
      </nav>
    </div>
  );
};

export default Home;
